import { FaEye, FaInfo, FaLink, FaStar, FaUtensils } from 'react-icons/fa'
import React from 'react'
import PropTypes from 'prop-types';

function RepoItem({ reposource }) {
    const {
        name,
        description,
        html_url,
        forks,
        open_issues,
        watchers_count,
        stagezers_count,
    } = reposource;

    return (
        <div className='mb-2 rounded-md card bg-gray-800 hover:bg-gray-900 '>
            <div className="card-body">
                <h3 className="mb-2 text-xl text-white font-semibold">
                    <a href={html_url}>
                        <FaLink className='inline mr-1' />{name}


                    </a>
                </h3>
                <p className="mb-3 text-white">{description}</p>
                <div>
                    <div className="mr-2 badge badge-info badge-lg">
                        <FaEye className='mr-2' /> {watchers_count}
                    </div>
                    <div className="mr-2 badge badge-success badge-lg">
                        <FaStar className='mr-2' /> {stagezers_count}
                    </div> <div className="mr-2 badge badge-error badge-lg">
                        <FaInfo className='mr-2' /> {open_issues}
                    </div> <div className="mr-2 badge badge-warning badge-lg">
                        <FaUtensils className='mr-2' /> {forks}
                    </div>
                </div>
            </div>
        </div>
    )
}
RepoItem.propTypes = {
    reposource: PropTypes.object.isRequired,
}

export default RepoItem
